import { persist } from 'redux/configureStore';
import './index.css';
const { persistor } = persist;

ReactDOM.createRoot(document.getElementById('root')).render(
  <React.StrictMode>
    <Provider store={store}>
      <PersistGate loading={<div>Å‚adowanie...</div>} persistor={persistor}>
        <App />
